// SPDX-License-Identifier: MIT
// how to create a library
pragma solidity ^0.8.9;

// Library Definition
library FundoorLib {
    function min(uint256 a, uint256 b) public pure returns (uint256) {
        return a < b ? a : b;
    }

    function max(uint256 a, uint256 b) public pure returns (uint256) {
        return a > b ? a : b;
    }
}

